import { images } from "../../config/images";

export const FaqProps = {
  faqBannerProps: {
    helpCardData: [
      {
        src: images.Question,
      },
      {
        src: images.Works,
      },
      {
        src: images.Progress,
      },
      {
        src: images.Information,
      },
    ],
  },
};
